message:
A leucoplasia oral é um tipo de lesão que afeta as mucosas da boca. As principais causas estão relacionadas ao contato dos tecidos com agentes irritantes, como o tabaco e as bebidas alcoólicas, além de traumatismos repetidos por dentes e próteses dentárias sem manutenção.

Essa lesão quando persistente na mucosa, pode ser um sinal de enfermidade grave, tal como um tumor maligno.
